import { Routes, Route, Navigate } from 'react-router-dom';
import Signup from '../pages/Signup';
import Login from '../pages/Login';
import Home from '../pages/Home';
import Profile from '../pages/Profile';
import RecipeDetail from '../pages/RecipeDetail';
import Bookmarks from '../pages/Bookmarks';
import CreateRecipe from '../pages/CreateRecipe';
import GroupRecipe from '../pages/GroupRecipe';

import { useAuth } from '../hooks/useAuth';

const AppRoutes = () => {
  const isLoggedIn = useAuth();

  return (
    <Routes>
      <Route path="/" element={<Home />} />
      <Route path="/signup" element={<Signup />} />
      <Route path="/login" element={<Login />} />
      <Route
        path="/profile"
        element={isLoggedIn ? <Profile /> : <Navigate to="/login" />}
      />
      <Route
        path="/recipes/:id"
        element={isLoggedIn ? <RecipeDetail /> : <Navigate to="/login" />}
      />
      <Route
        path="/bookmarks"
        element={isLoggedIn ? <Bookmarks /> : <Navigate to="/login" />}
      />
      <Route
        path="/create"
        element={isLoggedIn ? <CreateRecipe /> : <Navigate to="/login" />}
      />
      <Route
        path="/group"
        element={isLoggedIn ? <GroupRecipe /> : <Navigate to="/login" />}
      />
      {/* Catch all */}
      <Route path="*" element={<Navigate to="/" />} />
    </Routes>
  );
};

export default AppRoutes;
